Ltac solve_S fl Hstable SX :=
  let HIn := fresh in assert (HIn:~In (sort (map fl SX)) PA1) by
      (simpl map; simpl sort; intro; unfold PA1 in *;
       repeat (match goal with H:In _ (_::_) |- _ => inversion H;clear H; [discriminate |idtac] 
                          | H:In ?t [] |- _ => elim (in_nil H) end));
  let HS := fresh in assert (HS:In SX spreads) by (repeat (apply in_eq || apply in_cons));
  let HP := fresh in assert (HP:In SX PA0) by (repeat (apply in_eq || apply in_cons));
  destruct  (Hstable SX HS HP) as [Ha Hb];
  apply HIn; assumption.

Ltac solve_all fl Hstable := time (solve [solve_S fl Hstable S0 | solve_S fl Hstable S9 | solve_S fl Hstable S19 |
                             solve_S fl Hstable S24 | solve_S fl Hstable S36 | solve_S fl Hstable S46 |
                             solve_S fl Hstable S53]).

