Lemma decompose : forall (fp:Point->Point) (fl:Line->Line),
    forall l0 l1 l2 l3 l4 l5 l6 l7 l8 l9 l10 l11 l12 l13 L,
      In (fp, fl)
         (l0++l1++l2++l3++l4++l5++l6 ++l7++l8++l9++l10++l11++l12++l13++L)->
      In (fp, fl) (l0++l1++l2++l3++l4++l5++l6 ++l7++l8++l9++l10++l11++l12++l13) \/ In (fp,fl) L.
Proof.
  intros fp fl l0 l1 l2 l3 l4 l5 l6 l7 l8 l9 l10 l11 l12 l13 L.
  repeat rewrite in_app_iff; solve [intuition].
Qed.
 
Lemma not_iso : ~are_isomorphic PA0 PA1.
Proof.
  intro Hiso.
  unfold are_isomorphic in Hiso.  
  destruct Hiso as [fp [fl [Hfpfl Hstable]]].
  assert (HIn_S : In (fp,fl) all_collineations) by (apply is_collineations_descr_B; assumption).
  unfold all_collineations in HIn_S.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c0 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c1 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c2 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c3 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c4 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c5 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c6 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c7 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c8 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c9 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c10 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c11 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c12 fp fl); assumption.
  apply decompose in HIn_S; destruct HIn_S as [Hyp | HIn_S].
  apply (aux_c13 fp fl); assumption.
  apply (aux_c14 fp fl); assumption.
Qed.

